import React from "react";
import styles from "./carouselSingle.module.css";

const CarouselSingle = ({ restaurant }) => {
  const drawStarRating = restaurant => {
    for (const i = 0; i <= restaurant.rating; i++) {
      return <div className={styles.star}>{String.fromCharCode(9733)}</div>;
    }
  };

  return (
    <div className={styles.singleSlide}>
      <p>{restaurant.name}</p>
      <p>{drawStarRating}</p>
      <p>{restaurant.price}</p>
    </div>
  );
};

export default CarouselSingle;
